import React from 'react';

const Login = () => {

  const style = {
    margin : "20px",
  };

  return (
    <div style={style}>
      <div>
          <h1>로그인</h1>
      </div>
      <hr />
      <form>
        <div>
          <h2>Login Page</h2>
          <p>This is the about page content.</p>
        </div>
      </form>
    </div>
  );
};

export default Login;
